import React, { useState } from "react";
import "./App.css";
import { Form } from "./Component/Form";
import { JobsList } from "./Component/JobsList";

function App() {
  const [jobInput, setJobInput] = useState("");
  return (
    <div className="App">
      <header>
        <h1>Job Requests</h1>
      </header>
      <Form setJobInput={setJobInput} />
      <JobsList />
    </div>
  );
}

export default App;
